import { VueModel } from './VueModel';

export
class TemplateModel extends VueModel {
    defaults() {
        return {
            ...super.defaults(),
            ...{
                _model_name: 'TemplateModel',
                v_slot: null,
            },
        };
    }

    getVueTag() { // eslint-disable-line class-methods-use-this
        return 'template';
    }
}

TemplateModel.serializers = {
    ...VueModel.serializers,
};
